public void writeDot(String fileName) {
  if (fileName.indexOf('/') == -1) {
    fileName = "/l/la/lucene/core/" + fileName + ".dot";
  }
  try {
    PrintWriter pw = new PrintWriter(fileName);
    pw.println(toDot());
    pw.close();
  } catch (IOException ioe) {
    throw new RuntimeException(ioe);
  }
}

